import React from 'react';
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper
} from '@mui/material';

import Form from '../components/Form.js';

const Text2Image = () => {
    return (
        <Container maxWidth='xl' sx={{ py: 4 }}>
            <Grid2 container spacing={2}>
                <Grid2 size={{ xs: 12, md: 4 }}>
                    <Form />
                </Grid2>
                <Grid2 size={{ xs: 12, md: 8 }}>
                    <img src="" alt="" />
                </Grid2>
            </Grid2>
        </Container>
    )
}

export default Text2Image
